import {
  BrowserRouter,
  Route,
  Routes
} from 'react-router-dom'

import MainPage from './pages/main/MainPage'
import { ROUTER } from './router'

const { MAIN } = ROUTER
function PageRouter() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path={MAIN}>
          <Route
            index
            element={<MainPage />}
          />
        </Route>
      </Routes>
    </BrowserRouter>
  )
}
export default PageRouter
